                        <img
                          className="country__flag"
                          src="/assets/images/country-flag/austria-flag.png"
                          alt="Austria Flag"
                        />{" "}
                        MBBS In Austria
                      </Link>
                    </li>
                    <li>
                      <Link to="/mbbs-admission-in-poland-for-indian-students">
                        <img
                          className="country__flag"
                          src="/assets/images/country-flag/poland-flag.jpg"
