                        />{" "}
                        MBBS In Bulgaria
                      </Link>
                    </li>
                    <li>
                      <Link to="/mbbs-admission-in-nepal-for-indian-students">
                        <img
                          className="country__flag"
                          src="/assets/images/country-flag/nepal-flag.jpg"
